import React from 'react';

const Contact = () =>{
    return(
        <>
        <div className="contact_info">
            <div className="container-fluid">
                <div className="row">
                    <div className="col-lg-10 offset-1">
                        <div className="contact_info_item">
                            <img src="" alt="phone" />

                        </div>
                    </div>

            </div>

            </div>

        </div>
        </>
    )
}

export default Contact;
